import React from "react";
import "../stylesheets/ClubList.scss";
import Club from "./Club";

const ClubList = (props) => {
  return (
    <ul className="list">
      <Club icon={props.icon} name={props.name} members={props.members} />
    </ul>
  );
};

export default ClubList;
